import { Header } from './src/components/Header/Header';

const Page = () => {
  return (
    <div>
      {/* <Header /> */}
      <img src='images/menu.gif'/>
      <img src='images/searchbar.gif'/>
      <img src='images/speakers.png'/>
      <img src='images/footer.png'/>
    </div>
  );
};

export default Page;
